import React from "react";

interface EducationalArticleProps {
    article: string;
}

const EducationalArticle: React.FC<EducationalArticleProps> = (props) => {
    return (
        <div className={"EducationalArticle"}>
            <h4>Educational Article</h4>
            <p>{props.article}</p>
        </div>
    );
};

export default EducationalArticle;
